const Wrapper = styled.div`
  background-color: pink;
  position: absolute;
  top: 18rem;
  left: 10%;
  width: 80%;
  height: 42rem;
  z-index: -100;

  @media ${({ theme }) => theme.mobile} {
    width: 100%;
    height: 12rem;
    top: 12.5rem;
    left: 0;
  }
`;
